name: pipeline-with-mocks
description: a full pipeline seeded with data from mock-observations feature
tags: null
initialize:
  plugins:
    mock-observations:
      path: '@grnsft/if-plugins'
      method: MockObservations
      global-config:
        timestamp-from: 2024-05-13T00:00
        timestamp-to: 2024-05-13T01:00
        duration: 60
        components:
          - cloud/instance-type: A1
        generators:
          common:
            cloud/region: switzerland-north
            common-key: common-val
          randint:
            cpu/energy:
              min: 100
              max: 130
            cpu/utilization:
              min: 1
              max: 99
    operational-carbon:
      path: '@grnsft/if-plugins'
      method: Multiply
      global-config:
        input-parameters:
          - grid/carbon-intensity
          - cpu/energy
        output-parameter: carbon
    rename-parameter-plugin:
      path: rename-parameter-plugin
      method: RenameParameterPlugin
      global-config:
        keep-existing: true
    swiss-grid-plugin:
      path: swiss-grid-plugin
      method: SwissGridPlugin
      global-config:
        keep-existing: true
  outputs:
    - yaml
if-version: v0.3.2
tree:
  children:
    child-1:
      pipeline:
        - mock-observations
        - operational-carbon
        - rename-parameter-plugin
        - swiss-grid-plugin
      config:
        group-by:
          group:
            - cloud/region
            - instance-type
        rename-parameter-plugin:
          from-parameter: cpu/energy
          to-parameter: energy
      defaults:
